ECHO BOTH "Loading Countries Database\n";

USE Demo;


DROP TABLE demo.Flags;
DROP TABLE demo.Provinces;
DROP TABLE demo.Countries;

CREATE TABLE demo.Countries
	(Name VARCHAR(0) NOT NULL,
	 LAT REAL,
	 LNG REAL,
	 PRIMARY KEY(Name));

CREATE TABLE demo.Flags
	(Name VARCHAR(128) references Countries (Name),
	 Flag LONG VARBINARY,
	 PRIMARY KEY(Name));

CREATE TABLE demo.Provinces
	(Country VARCHAR NOT NULL references Countries (Name),
	 Province VARCHAR NOT NULL,
	 PRIMARY KEY(Country,Province));

